import { withAuthenticator } from "@aws-amplify/ui-react";
import "@aws-amplify/ui-react/styles.css";
import callApiDynamo from "./CallApi.js";
const Mainfunc = () => {
  return (
    <div>
      <h1>REDACTED PAGES REACHED</h1>
      <button onclick="callApiDynamo()"> Click Me </button>
    </div>
  );
};

export default withAuthenticator(Mainfunc);
